import React from 'react';
import { 
  Heading, 
  Paragraph, 
  Card, 
  Tag, 
  Link 
} from '@digdir/designsystemet-react';

interface SlackChannel {
  name: string;
  purpose: string;
  members: number;
  category: string;
}

const SlackChannels: React.FC = () => {
  const channels: SlackChannel[] = [
    {
      name: 'designsystemet-generelt',
      purpose: 'Generelle diskusjoner om Designsystemet',
      members: 450,
      category: 'Hovedkanal'
    },
    {
      name: 'designsystemet-hjelp',
      purpose: 'Teknisk støtte og feilsøking',
      members: 380,
      category: 'Support'
    },
    {
      name: 'designsystemet-tilgjengelighet',
      purpose: 'Diskusjoner om tilgjengelighet og WCAG',
      members: 420,
      category: 'Spesialisert'
    },
    {
      name: 'designsystemet-varsler',
      purpose: 'Oppdateringer og viktige kunngjøringer',
      members: 420,
      category: 'Kunngjøringer'
    }
  ];

  const getCategoryColor = (category: string): "success" | "warning" | "info" | "first" => {
    switch (category.toLowerCase()) {
      case 'hovedkanal':
        return 'success';
      case 'support':
        return 'warning';
      case 'spesialisert':
        return 'info';
      case 'kunngjøringer':
        return 'first';
      default:
        return 'first';
    }
  };

  return (
    <div>
      <Heading level={1} size="xlarge" spacing>
        Slack-kanaler
      </Heading>
      <Paragraph spacing>
        Finn relevante Slack-kanaler for Designsystemet-diskusjoner og støtte.
      </Paragraph>

      <Card>
        <div style={{ padding: '1rem' }}>
          <table style={{ width: '100%', borderCollapse: 'collapse' }}>
            <thead>
              <tr>
                <th style={{ textAlign: 'left', padding: '0.5rem' }}>Kanal</th>
                <th style={{ textAlign: 'left', padding: '0.5rem' }}>Beskrivelse</th>
                <th style={{ textAlign: 'left', padding: '0.5rem' }}>Type</th>
              </tr>
            </thead>
            <tbody>
              {channels.map((channel) => (
                <tr key={channel.name}>
                  <td style={{ padding: '0.5rem' }}>
                    <Link href={`slack://channel?team=T0XXXXX&id=${channel.name}`}>
                      #{channel.name}
                    </Link>
                  </td>
                  <td style={{ padding: '0.5rem' }}>{channel.purpose}</td>
                  <td style={{ padding: '0.5rem' }}>
                    <Tag
                      size="small"
                      color={getCategoryColor(channel.category)}
                    >
                      {channel.category}
                    </Tag>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </Card>

      <div style={{ marginTop: '2rem' }}>
        <Heading level={2} size="medium" spacing>
          Retningslinjer for kanalbruk
        </Heading>
        <Card>
          <div style={{ padding: '1rem' }}>
            <ul style={{ listStyle: 'none', padding: 0 }}>
              {channels.map((channel) => (
                <li key={channel.name} style={{ marginBottom: '1rem' }}>
                  <Tag size="small" color={getCategoryColor(channel.category)}>
                    {channel.category}
                  </Tag>
                  <Paragraph spacing>{channel.purpose}</Paragraph>
                </li>
              ))}
            </ul>
          </div>
        </Card>
      </div>
    </div>
  );
};

export default SlackChannels;
